  `token` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT 'token',
  `body` text COLLATE utf8_bin COMMENT '请求内容',
  `method` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '请求方法（针对jsf接口调用的方法名称）',
  `type` int(11) NOT NULL COMMENT '接口类型(1jsf  2post  3get)',
  `dataFetch` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '数据提取器',
